import React from 'react';
import './index.css'
import Item from '../Item';

class List extends React.Component {
  
    render() {
        const {todos}=this.props
        return (
            <ul className="todo-main">
       { todos.map( todo =>{           
            return <Item  key={this.id} id={todos.id} name={todos.name} /> 
        })
       }
      </ul>
        )
    }
}

export default List;
